public class IntergerNumbers {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		// Print the larger of two numbers
		int x = 5;
		int y = 10;
		
		if(x > y ) {
			// if x is greater than y print x
			System.out.println(x);
			} else {
				// else print y
				System.out.println(y);
			}
		}
	}
